import React from "react";
import s from "./bestsellers.module.css";
import img1 from "./../../assets/product03-1-480x360.jpg";
import img2 from "./../../assets/product05-1-480x360.jpg";
import img3 from "./../../assets/product06-1-480x360.jpg";
import CustomButton from "../../components/customButton/customButton";
import Slide from "react-reveal/Slide";

const Bestsellers = () => {
  return (
    <div className={s.bestsellersContainer}>
      <div className={s.bestsellerInner}>
        <h2 className={s.bestsellerTitle}>OUR BEST SELLERS</h2>
        <div className={s.list}>
          <Slide bottom>
            <div className={s.point}>
              <img src={img1} alt={"Small Cuboctahedron Terrarium"} />
              <h2>Small Cuboctahedron Terrarium</h2>
              <span>rating</span>
              <p>$55-$65</p>
            </div>
          </Slide>
          <Slide bottom>
            <div className={s.point}>
              <img src={img2} alt={"Medium Glass House"} />
              <h2>Medium Glass House</h2>
              <span>rating</span>
              <p>$70-$75</p>
            </div>
          </Slide>
          <Slide bottom>
            <div className={s.point}>
              <img src={img3} alt={"Small Icosahedron Terrarium"} />
              <h2>Small Icosahedron Terrarium</h2>
              <span>rating</span>
              <p>$65-$75</p>
            </div>
          </Slide>
        </div>
        <CustomButton title={"Browse all Products"} className={"gold"} />
        <div></div>
      </div>
    </div>
  );
};

export default Bestsellers;
